function App() {




  const handleDownloadDocument = ( url, documentId) => {        

    let postData = {"URL":url, "documentId":documentId}
    fetch(
      `${process.env.REACT_APP_KMS_DJANGO_URL}/api/upload/download-document/`,
      {
      method: "POST",
      headers: {
      "Content-Type": "application/json;charset=utf-8",
      Authorization: `Bearer ${localStorage.getItem("token")}`,
      },
      body: JSON.stringify(postData),
      }
      ).then(async (res) => {

          var downloadResponse = await res.json();
          window.open(downloadResponse['download_url'],'_self')

      }
      );


  }
  return (
   <>
   <h1>my app</h1>
   </>
  );
}

